export interface ResponseProductDTO {
    imageSrc: string
    productDescription: string
    productName: string
    productId?: number
    positionId?: number
    organizationName: string
    organizationId: number
    properties: string[]
    isProtectedDeal: boolean
    price: number
    bookmarks: boolean
    clientCount: number
    trust: TrustLevel
    type: ProductType
    score: number
}

export enum TrustLevel {
    LOW = 'Не надежный',
    MEDIUM = 'Нейтральный',
    HIGH = 'Надеждный'
}

export enum ProductType {
    PRODUCT = 'Продукт',
    SERVICE = 'Услуга'
}

export interface ResponseSimilarProductsDTO {
    positions: ResponseProductDTO[]
}

export interface RequestSimilarProductOffersDTO {
    positionId: number
    currentOrganizationId: number
}

export interface RequestProductDTO {
    positionId: number
}
